If you have a big button print lots of supports.   The button is however unnecessary.  Try these settings to replace it with an easy to print stopper instead:   
// Button Width<br />
button_width_numerical_slider = 8  
// Button Thickness<br />
button_thickness_numerical_slider = 10  
// Button Taper Percentage %<br />
button_taper_numberical_slider = -20
